France - Midi-Pyrenees
Escape to the Continent, Series 1 Episode 18 of 20

Alistair Appleton is helping a couple from Lincolnshire satisfy their dream of a healthier lifestyle by finding them a new home in the Midi-Pyrenees region of France.

As well as unveiling some beautiful properties, Alistair offers hints and tips on moving to France.

